				<div class="elementor-widget-container">
					<div class="elementor-text-editor elementor-clearfix"><p style="text-align: left;">Because we care about you, your family and our planet, we only use the very best coffee that is ethically sourced and locally roasted by the White Whale Coffee Roasters. A percentage of profits from every purchase of beans we make now goes to The Reef Restoration Foundation to assist them in establishing more ocean based coral nurseries that regenerate coral on the Great Barrier Reef.</p><p>We only use Mungalli milk, from locally farmed cows on the Tablelands, our Syrups for coffee and frappes are from a family owned Australian company and contain no artificial colours and flavours. Our cups and lids are biodegradable and compostable with lids and lining made from plant materials not plastic and we use only paper straws.</p><p>The Coffee Can has been operating in Cairns for four years now, in fact we were the first and, as far as we are aware, still the only consistently eco-friendly coffee van. We now have a Cafe in Redlynch from which we bake all our cakes and we also have a Coffee Cart which we use for corporate events, weddings and indoor venues.</p><p>We are passionate about coffee, supporting other local businesses and great customer service. We were recently asked to provide a coffee service for the Cairns Regional Council offices whilst their own Cafe took some time off over Christmas, after some great feedback, we have been asked to go back next year.</p></div>
